function navbarexpand(e) {
    // var navbarMinimize = document.querySelectorAll('.nMinimize');

    // var g_body = document.getElementById("g_body");

    // onn tagler
    if (e.checked) {
        document.querySelector(".g-sidenav-show").classList.remove("g-sidenav-hidden");
        document.querySelector(".g-sidenav-show").classList.add("g-sidenav-pinned");
    }
    // off tagler
    else {
        document.querySelector(".g-sidenav-show").classList.add("g-sidenav-hidden");
        document.querySelector(".g-sidenav-show").classList.remove("g-sidenav-pinned");
    }
}
function navbarexpand2() {
    var nExpand = document.querySelector(".nExpand");
  if (nExpand.checked) {
        document.querySelector(".g-sidenav-show").classList.add("g-sidenav-hidden");
        document.querySelector(".g-sidenav-show").classList.remove("g-sidenav-pinned");
        nExpand.removeAttribute("checked");
  }
  // off tagler
  else {
    document.querySelector(".g-sidenav-show").classList.remove("g-sidenav-hidden");
    document.querySelector(".g-sidenav-show").classList.add("g-sidenav-pinned");
    nExpand.setAttribute("checked", "");
  }
}

